  [],\n\t\"revision_timestamp\": \"2016-10-01T12:59:39.423272\",\n\t\"name\": \"freshwater-mussel-surveys-of-the-pee-dee-river-basin-in-south-carolina\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Pee Dee River Basin is a major drainage
  of the Atlantic slope in the southeastern United States. The 10,755 sq mile drainage
  area incorporates portions of Virginia, North Carolina and South Carolina. A total
  of 3,425 sq. miles occurs within the lower piedmont and coastal plain in the northeastern
  portion of South Carolina, making it the secondlargest river basin in the state.
  With the exception of a series of hydroelectric reservoirs on the main-stem in North
  Carolina, the lower portion of the basin is generally freeflowing, with extensive
  forested buffers that are relatively free of urban development. Knowledge of the
  mussel fauna in the lower portion of the basin has been limited to scattered locales,
  largely in smaller tributaries, and shallow water habitats. Very little information
  existed for the deep water habitats throughout the basin. In an attempt to update
  and fill in major gaps in the knowledge of the mussel fauna in this basin The Catena
  Group, Inc. (TCG) was retained by the South Carolina chapter of The Nature Conservancy
  (SCTNC) to conduct a qualitative assessment of the Unionid fauna in the lower Pee
  Dee River and its major tributaries; The Black, Lynches, Pocotaligo, Little Pee
  Dee, and Waccamaw Rivers, in South Carolina. In addition to sites surveyed for this
  project, other sites in the Pee Dee River Basin in South Carolina were also surveyed
  by the Catena Group during this period of time and these results are also included
  in this report.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
